import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import { Link } from 'react-router-dom';

function UncontrolledExample() {
    return (

        <>
            <div className='outerDiv'>
                <div id="carousalImg" class="carouselSlide" data-bs-ride="carousel" style={{paddingLeft:"10%" , paddingRight:"10%"}}>
                    <div class="carousel-indicators">
                        <button type="button" data-bs-target="#carousalImg" data-bs-slide-to="0" class="active" aria-current="true" aria-label="Slide 1"></button>
                        <button type="button" data-bs-target="#carousalImg" data-bs-slide-to="1" aria-label="Slide 2"></button>
                        <button type="button" data-bs-target="#carousalImg" data-bs-slide-to="2" aria-label="Slide 3"></button>
                    </div>
                    <div class="carousel-inner">
                        <div class="carousel-item active">
                            <img src="Images/EVCSB.png" class="w-100 " alt="..." />
                        </div>
                        <div class="carousel-item">
                            <img src="Images/EVCSB2.png" class="w-100 " alt="..." />
                        </div>
                        <div class="carousel-item">
                            <img src="Images/EVCSB3.png" class="w-100 " alt="..." />
                        </div>
                    </div>
                    <button class="carousel-control-prev" type="button" data-bs-target="#carousalImg" data-bs-slide="prev">
                        <span class="carousel-control-prev-icon" aria-hidden="true"></span>
                        <span class="visually-hidden">Previous</span>
                    </button>
                    <button class="carousel-control-next" type="button" data-bs-target="#carousalImg" data-bs-slide="next">
                        <span class="carousel-control-next-icon" aria-hidden="true"></span>
                        <span class="visually-hidden">Next</span>
                    </button>
                </div>
            </div>
        </>

        // <Carousel style={{ width: "65%", marginTop: "4%", marginBottom: "4%", marginLeft: "auto", marginRight: "auto", display: "block", height: "30%" }} >


        //         <Carousel.Item>
        //         <a href="PDFs/tesla.pdf" target="_blank" rel = "noreferrer" >
        //             <img
        //                 className="d-block w-100"
        //                 src="Images/EVCSB.png"
        //                 alt="First slide"

        //             />
        //                  </a>

        //         </Carousel.Item>



        //         <Carousel.Item>
        //         <a href="PDFs/basic.pdf" target="_blank" rel = "noreferrer">
        //             <img
        //                 className="d-block w-100"
        //                 src="Images/EVCSB2.png"
        //                 alt="Second slide"

        //             />
        //                </a>


        //         </Carousel.Item>




        //         <Carousel.Item>
        //         <a href="PDFs/basic.pdf" target="_blank" rel = "noreferrer">
        //             <img
        //                 className="d-block w-100"
        //                 src="Images/EVCSB3.png"
        //                 alt="Third slide"

        //             />
        //         </a>
        //         </Carousel.Item>



        // </Carousel>
    );
}

export default UncontrolledExample;
